import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div className="Nav">
      <div>
        <li>About Me</li>
        <li>Projects</li>
        <li>Resume</li>
        <li>Contact</li>
      </div>
    </div>
  );
}

export default Nav;
